    val_statistic_details.insert( String::from("threads_running"), ValueStatisticDetails { unit: String::from("threads"), unit_suffix: String::from("threads"), stat_type: String::from("gauge") } );
    val_statistic_details.insert( String::from("threads_running_Master_reactor"), ValueStatisticDetails { unit: String::from("threads"), unit_suffix: String::from("threads"), stat_type: String::from("gauge") } );
